import Auth from "@/models/Auth";
import axios from "axios";

export default (to, from, next) => {
  let isLogged = false;

  axios.get('validate-token').then(response => {
    if (response.status === 200) {
      isLogged = true;
    }
  });

  if (!isLogged) {
    next({ name: 'login' });
    return;
  }

  /*
  if( !Auth.check() ) {
    next({ name: 'login' });
  }
  */
}
